ERROR - 2018-07-31 18:00:46 --> SELECT `promociones`.`id_promo`, `promociones`.`activo`, `promociones`.`vendido`, `promociones`.`descripcion`, `promociones`.`precio_promo`, GROUP_CONCAT(CONCAT(servicios_promo.cantidad, ' '), servicios.descripcion SEPARATOR ', ') as servicios, GROUP_CONCAT(CONCAT(productos_promo.cantidad, ' '), productos.descripcion SEPARATOR ', ') as productos, `promociones`.`fecha_inicio`, `promociones`.`fecha_fin`
FROM `promociones`
LEFT JOIN `servicios_promo` ON `promociones`.`id_promo` = `servicios_promo`.`id_promo`
LEFT JOIN `servicios` ON `servicios`.`id_servicio` = `servicios_promo`.`id_servicio`
LEFT JOIN `productos_promo` ON `promociones`.`id_promo` = `productos_promo`.`id_promo`
LEFT JOIN `productos` ON `productos_promo`.`id_producto` = `productos`.`id_producto`
WHERE `promociones`.`fecha_fin` >= '2018-07-31'
AND promociones.activo = 1
GROUP BY `promociones`.`id_promo`
